import './navbar.scss'
function Navbar(){
    return(
        <div className='navbar'>
            <div className="logo">
                <img src="/img/Logo.png" alt="logo" />
                <img src="/img/hs-title.png" alt="logo" />
            </div>
        </div>
    )
}

export default Navbar;
